        zoom={15}
        style={mapStyles}
        initialCenter={{
         lat: 18.796143,
         lng: 98.979263
        }}
      />
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyCS4QDM_de0JGU7Qux2xa4VhxtVdmgXRJA'
})(MapContainer);
